import styled from 'styled-components';

export const StyledNavBarLeft = styled.div`
    display: flex;
    justify-content: center;
    align-items: center;
`;
export const StyledNavBarUl = styled.ul`
    list-style: none;
    flex-direction: row;
    display: flex;
`;
export const StyledNavBarLi = styled.li`
    padding-right: 10px;
`;
